public static synchronized void addCategory(Category c) {
    categories.add(c);
}

public static synchronized Category getCategory(String name) {
    Iterator<Category> it = categories.iterator();
    while (it.hasNext()) {
        Category c = it.next();
        if (c.getName().equals(name)) {
            return c;
        }
    }
    return null;
}

